import React from 'react'

const Example = (props) => {
    const {
        dt_txt,
        main: temp
    } = props.forecast.list

    const dailyTemperatures = {};

    props.forecast.list.forEach((item) => {
        const date = new Date(item.dt_txt.split(' ')[0]).toDateString();
        console.log(dailyTemperatures[date])
        if (!dailyTemperatures[date]) {
            dailyTemperatures[date] = {
                date,
                hourlyTemperatures: [],
                temp_min: item.main.temp_min,
                temp_max: item.main.temp_max
            };
        } else {
            if (item.main.temp_min < dailyTemperatures[date].temp_min) {
                dailyTemperatures[date].temp_min = item.main.temp_min;
            }
            if (item.main.temp_max > dailyTemperatures[date].temp_max) {
                dailyTemperatures[date].temp_max = item.main.temp_max;
            }
        }

        dailyTemperatures[date].hourlyTemperatures.push({
            time: item.dt_txt.split(' ')[1],
            temp: item.main.temp
        });
    });

    console.log(Object.values(dailyTemperatures));
    return (
        <div>{dailyTemperatures[date]}</div>
    )
}

export default Example
